def getRes():
    request = urllib.request.Request(url)
    request.add_header("user-agent","Mozilla/5.0")
    response2 = urllib.request.urlopen(request).read().decode('utf-8')
    ##指定文档解析器
    res2=[]
    soup = BeautifulSoup(response2,'html.parser')
    res1=[]
    for link in soup.find_all('div',attrs={'class':'date'}):
        res2.append(link.get_text())
    for link in soup.find_all('a',attrs={"class" :"list-field1 f_moreToe f_2row isTop"}):
        res1.append(link.get_text())
    return res1,res2

