#获取数据的线程
class BackEnd1(QThread):
    update_date = pyqtSignal(list,list)
    def run(self):
        global cnt
        while True:
            data1,data2=getRes()
            cnt=cnt+1
            self.update_date.emit(data1,data2)
            time.sleep(5)

