#控制弹窗的线程
class BackEnd2(QThread):
    update_date=pyqtSignal(str)
    def run(self):
        global showFlag
        while True:
            time.sleep(0.1)
            self.update_date.emit(" ")

            if newsFlag:
                if not showFlag: ###有新消息 但是用户不允许
                    global interval
                    if(type(interval)==int):
                        time.sleep(interval)
                    else:
                        time.sleep(1)
                    showFlag=True

#控制弹窗的线程
class BackEnd3(QThread):
    update_date=pyqtSignal(str)
    def run(self):
        while True:
            self.update_date.emit("")


